import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import BarChart from './BarChart'; // Import your chart components
import authenticatedFetch from './authenticatedFetch';

function SurveyVisualizations() {
  const [aggregatedData, setAggregatedData] = useState([]);
  const { surveyId } = useParams();

  useEffect(() => {
    authenticatedFetch(`https://bookish-pancake-q7w7vvr66ggfxp5j-3000.app.github.dev/survey-responses/:surveyId/visualize`)
      .then(response => response.json())
      .then(data => setAggregatedData(data))
      .catch(error => console.error('Error fetching aggregated data:', error));
  }, [surveyId]);

  // Render charts based on aggregated data
  return (
    <div className="p-4 shadow-lg">
      <h2 className="text-2xl font-bold mb-4">Survey Visualizations</h2>
      {/* Render charts here. Example for a bar chart: */}
      {aggregatedData.map((data, index) => (
        <BarChart key={index} data={data} />
      ))}
    </div>
  );
}

export default SurveyVisualizations;
